scriptlet.script:
try{
	monthValueP = parseInt(monthValue);
	monthValueF = parseInt(monthValueFuture);
	yearValueP = parseInt(yearValue);
	yearValueF = parseInt(yearValueFuture);
	yearDif=yearValueF-yearValueP;
	noOfMonth=12*yearDif;
	if((monthValueF-monthValueP)>0)
	{
	noOfMonth=noOfMonth+(monthValueF-monthValueP);
	}
	else
	noOfMonth=noOfMonth-(monthValueP-monthValueF);
	scriptletContext.put("noOfTerms",noOfMonth);
	response = "success";
}
catch(err) {
	scriptletContext.put("errorMessages",err.message);	
	response = "failure";
}
scriptletResponse = response

try{
	p = parseFloat(repayPrincipal);
	r = parseFloat(repayRate);
	amount=((p*r)/365)*31;
	scriptletContext.put("repaymentAmount",amount);
	response = "success";
} catch(err) {
	scriptletContext.put("errorMessages",err.message);	
	response = "failure";
}
scriptletResponse = response

try{
	p = parseFloat(repayPrincipal);
	r = parseFloat(repayRate);
	n = parseFloat(repayTerm);
	r = r/12;
	tempValue1 = Math.pow((1+r),n);
	tempValue2 = r*tempValue1;
	tempValue3 = (tempValue1-1);
	tempValue4 = tempValue2/tempValue3;
	amount = tempValue4*p;
	scriptletContext.put("repaymentAmount",amount);
	response = "success";
} 
catch(err) {
	scriptletContext.put("errorMessages",err.message);	
	response = "failure";
}
scriptletResponse = response
